import React, { useState } from "react";


const App = () => {
    const crnTime = new Date().toLocaleTimeString();

    const [cTime, getTime] = useState(crnTime)

    const ClickTime = () =>{
        crnTime = new Date().toLocaleTimeString();
        getTime(crnTime);
    };
    return(
   <div>
   <h1> {cTime} </h1>
   <button onClick={ClickTime}>Get Time</button>
   </div>
    )
};

export default App;
